import React from 'react';
import { CssBaseline } from '@mui/material';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './Pages/Login';
import MyPlan from './Pages/MyPlan';
import Biceps from './Pages/Exercises/Biceps';
import Shoulder from './Pages/Exercises/Shoulder';
// Import other exercise pages as needed

function App() {
  return (
    <div className="App">
      <CssBaseline />
      <Router>
        <Routes>
          <Route path="/" element={<Login />} />
          <Route path="/myplan" element={<MyPlan />} />
          <Route path="/biceps" element={<Biceps />} />
          <Route path="/shoulder" element={<Shoulder />} />
          {/* Add more routes here for other body parts */}
        </Routes>
      </Router>
    </div>
  );
}

export default App;
